import React, {useState} from 'react';
import Icon from 'react-native-vector-icons/Feather';
import Icon2  from 'react-native-vector-icons/AntDesign';
import Icon3 from 'react-native-vector-icons/MaterialIcons';
import {View, SafeAreaView, Text, StyleSheet, TextInput, FlatList, Image, ScrollView, TouchableOpacity} from 'react-native';
import {status} from '../data/list';
import {products} from '../data/list';
import {productsPage2} from './list';
import {products2Page2} from './list';

export default function TestDrive(){
	const [brandView, setBrandView]= useState(true);
	const handleBrandView = ()=>{
		setBrandView(!brandView)
	}
	
	return(
		<SafeAreaView style= {styles.container}>
			<View style={styles.vector}>
				<Icon2 name="back" style={{marginLeft:20}} size={25} color="#C3AD60" />
				<View style={styles.vectorRight}>
					<Icon name="search" style={{marginRight:25}} size={25} color="#C3AD60" />
					<Icon name="shopping-cart" style={{marginRight:25}} size={25} color="#C3AD60" />
					<TouchableOpacity onPress={()=>handleBrandView()}>
						<Icon3 name="filter-list" style={{marginRight:20}} size={25} color="#C3AD60" />
					</TouchableOpacity>
				</View>
			</View>

			<View style={{flex:1}}>
				<View style={{flexDirection:'row', justifyContent:'space-between', marginLeft:20, marginRight:20}}>
					<Text style={{color:'white'}}>
						PREMIUM BRANDS
					</Text>
					<Text style={{color:'white'}}>
						see all
					</Text>
				</View>

			{
				brandView ?
				<View style={{alignItems:'center', justifyContent:'center', height:'90%'}}>
				
								<FlatList
						data={productsPage2}
						key={1}
						numColumns={3}
						showsVerticalScrollIndicator={false}
						keyExtractor={(item, index)=>index.toString()}
						renderItem={({item, index})=>
							<View style={styles.imageVieww}>
							
								<Image source={item.image} style={styles.image} key={index}/>
								<Text style={styles.brandName}>Product Name</Text>
								<Text style={styles.km}>N0.00</Text>
							</View>
						}
						/>

			</View>
			:
			<View style={{height:'95%'}}>
				
								<FlatList
						data={productsPage2}
						key={2}
						showsVerticalScrollIndicator={false}
						keyExtractor={(item, index)=>index.toString()}
						renderItem={({item, index})=>
							<View style={styles.imageVieww2}>
							
								<Image source={item.image} style={styles.image} key={index}/>
								<View style={{flexDirection:'column', marginTop:20}}>
									<Text style={styles.brandName}>Product Name</Text>
									<Text style={styles.km}>Lorem ipsum dolor, sit ahmet...</Text>
								</View>
							</View>
						}
						/>

			</View>
			}
				
			</View>
			
				<View style={{flex:1}}>
				<View style={{flexDirection:'row', justifyContent:'space-between', marginLeft:20, marginRight:20}}>
					<Text style={{color:'white'}}>
						REGULAR BRANDS
					</Text>
					<Text style={{color:'white'}}>
						see all
					</Text>
				</View>
				{
				brandView ?
			<View style={{alignItems:'center', justifyContent:'center', flex:1, height:'90%'}}>
				<FlatList
						data={products2Page2}
						numColumns={3}
						showsVerticalScrollIndicator={false}
						keyExtractor={(item, index)=>index.toString()}
						renderItem={({item, index})=>
							<View style={styles.imageVieww}>
							
								<Image source={item.image} style={styles.image} key={index}/>
								<View>
									<Text style={styles.brandName}>Product Name</Text>
									<Text style={styles.km}>N0.00</Text>
								</View>
								
							</View>
						}
						/>

			</View>
			:
			<View style={{height:'95%'}}>
				
								<FlatList
						data={products2Page2}
						key={2}
						showsVerticalScrollIndicator={false}
						keyExtractor={(item, index)=>index.toString()}
						renderItem={({item, index})=>
							<View style={styles.imageVieww2}>
							
								<Image source={item.image} style={styles.image} key={index}/>
								<View style={{flexDirection:'column', marginTop:20}}>
									<Text style={styles.brandName}>Product Name</Text>
									<Text style={styles.km}>Lorem ipsum dolor, sit ahmet...</Text>
								</View>
							</View>
						}
						/>

			</View>
		}
			</View>
		</SafeAreaView>

		)
}
const styles = StyleSheet.create({
	container:{
		flex:1,
		backgroundColor:'#000000',
	},
	industry:{
		height:'30%', 
		justifyContent:'center'
	},
	industryText:{
		color:'#C3AD60', 
		fontFamily:'Roboto', 
		fontWeight:'400', 
		fontSize:15, 
		lineHeight:21.09, 
		marginLeft:20
	},
	seeAllView:{
		alignItems:'flex-end', 
		marginRight:20
	},
	seeAll:{
		color:'white',  
		fontSize:12, 
		fontFamily:'Roboto', 
		fontWeight:'700', 
		lineHeight:14,
		marginLeft:20
	},
	brandName:{
		fontSize:17, 
		fontWeight:'400', 
		fontFamily:'Roboto', 
		color:'white', 
		fontSize:15,
		paddingBottom:5
	},
	km:{
		color:'#4E4E4E', 
		fontFamily:'Roboto',
		marginTop:15
	},
	input:{
		backgroundColor:'#444444',
		borderColor:'#777777',
		borderRadius:8,
		width:'90%',
		height:'50%'
		
	},	
	inputView:{
		alignItems:'center',
		justifyContent:'center',
		height:'10%'
	},
	image:{
		height:80,
		width:80,
		margin:20,
		borderRadius:5
	},

	imageView:{
		alignItems:'center',
		justifyContent:'center'
	},
	imageVieww:{
		alignItems:'center',
		justifyContent:'center',
		margin:0,
		padding:0
	},
	imageVieww2:{
		flexDirection:'row',
		margin:0,
		padding:0
	},

	vector:{
		flexDirection:'row',
		justifyContent:'space-between',
		height:80,
		alignItems:'center'
	},
	vectorRight:{
		flexDirection:'row',
		
	},
	ad:{
		marginTop:40,
		marginBottom:40  
	},
	imageAd:{
		height:140,
		width:'100%'
	}


})
